.article {
  width: 90%;
  margin: 0 auto;
}
@media (min-width: 768px) {
  .article {
    width: 700px;
    display: flex;
    justify-content: space-between;
  }
}
@media (min-width: 992px) {
  .article {
    flex-direction: row-reverse;
  }
}
.article__picture {
  height: 200px;
  background: black;
}
@media (min-width: 768px) {
  .article__picture {
    width: 200px;
  }
}
@media (min-width: 768px) {
  .article__container {
    width: 460px;
  }
}
